// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;
import "hardhat/console.sol";

contract BaggageTracker {

    uint val = 5;

    address private boardingOfficial;

    constructor() {
        console.log("Baggage Contract deployed by : ", msg.sender);
        boardingOfficial = msg.sender;
    }

    function getBoardingOfficial() public view returns(address){
        return boardingOfficial;
    }

}

